package com.selectionarts.projectcensio.openReqServices.eDemocracy.model.report;

public class EDemoSchedule {
	
	private String project_start;
	private String project_end;
	private String phase_candidates_at;
	private String current_phase;

	public EDemoSchedule() {
		// TODO Auto-generated constructor stub
	}

	public String getProject_start() {
		return project_start;
	}

	public void setProject_start(String project_start) {
		this.project_start = project_start;
	}

	public String getProject_end() {
		return project_end;
	}

	public void setProject_end(String project_end) {
		this.project_end = project_end;
	}

	public String getPhase_candidates_at() {
		return phase_candidates_at;
	}

	public void setPhase_candidates_at(String phase_candidates_at) {
		this.phase_candidates_at = phase_candidates_at;
	}

	public String getCurrent_phase() {
		return current_phase;
	}

	public void setCurrent_phase(String current_phase) {
		this.current_phase = current_phase;
	}
	
	
}
